    "Deskripsi":"High quality, quiet, extended estate, 100 meters from Lovina Beach  * Situated at one of Lovina\\'s coziest and lively streets: Jalan Mawar * Land, situated along the street, ideal to start a business: restaurant or hotel * Magical garden with guesthouses and swimming-pool * A steady cooperation of decades with Balinese family, who own land next to us The land The estate Rumah Kita is situated in the village of Kalibukbuk, less than a hundred meters from the quiet and magnificent Lovina Beach, North Bali. The site has its own access to the Jalan Mawar, one of the most popular streets of central Lovina Beach, near the still unspoiled nature of jungles, plantations and rice fields and a short distance from most sights. The part which is for sale is 1875 m2 (2215 square yards). Till now the estate was owned by Dutch people in steady cooperation with a Balinese family. The magical garden The magical garden is the common denominator at Rumah Kita. Wherever you are, the lush, tranquil garden with beautiful tropical flowers, palms, banana and mango trees, is always prominently present. The garden provides enough shade from the fruit trees to lay down and read a book, enjoy a nice massage or play badminton on the court next to the swimming pool. Due to the growth and the shape of the garden, from each guesthouse, the other one is barely or not at all visible.  The swimming pool Beautifully set in this garden is a large swimming pool with a separate shallow water space for young children. Wake up with the singing birds in the garden and have a swim before enjoying your breakfast at the poolside. Around the pool, we have several chairs and sunbeds for complete relaxation. The guesthouses A substantial part the estate is for sale, with the two guesthouses Wantilan and Glebeg Baru. Wantilan and Glebeg Baru have so-called roofed living terraces downstairs, living rooms of open construction, following the typical, traditional Balinese style of living. The garden as a direct extension of the living room, adds considerably to a feeling of oneness with nature. Wantilan, the largest guesthouse, can accommodate six to eight people. It features five bedrooms, an open kitchen and a very large sitting room, bordering a terrace with a view on the tropical garden.  The two separate sleeping areas both consist of one room with one large queen bed and a somewhat separate space with a single bed - each has an extra private terrace a huge, separate bathroom with a shower and warm water bathtub, walled but in the open air! Apart from this Wantilan also includes a romantic tower room with a small double bed.  The cozy house Gelebeg Baru actually consists of two houses, suitable for four people. The first house has a roomy, open living/dining room, an open kitchen and a bathroom, also half outside. The \\'living terrace\\', just like Wantilan, directly borders the luscious garden. On the first floor, there is a very large bedroom with a spacious double bed. The second house - built in the style of a Balinese rice house - features a massage room downstairs, and upstairs a romantic terrace with a small bedroom with a double bed. These two houses lean unto each other beautifully and can, therefore, be inhabited by one family.",
